class App extends React.Component {
    constructor(props){
        super(props);
    }

    render(){
        window.navigator.geolocation.getCurrentPosition(
        (position)=>console.log(position),
        (error)=>console.log(error)
        );

        return <div>Latitude:</div>;
    }
}

ReactDOM.render(
    <App/>,document.querySelector('#root')
);
